import React, { Component } from "react";

class Avantage extends Component {
  render() {
    const { data, manufacturer } = this.props;

    const hasManufacturer = data.map((product) => {
      return product.fabricant === manufacturer;
    });

    if (hasManufacturer) {
      return (
        <div className="avantage">
          <img src={data.image} alt={data.name} className="avantage-icone" />
          <h3 className="avantage-title">{data.name}</h3>
          <p className="avantage-description">{data.description}</p>
        </div>
      );
    } else {
      return null;
    }
  }
}

export default Avantage;

export function test({ data, fabricant }) {
  return (
    <div>
      {data.map(
        (item) =>
          item.fabricant ===
          "softub"(
            <div className="avantage">
              <img
                src={item.image}
                alt={item.name}
                className="avantage-icone"
              />
              <h3 className="avantage-title">{item.name}</h3>
              <p className="avantage-description">{item.description}</p>
            </div>
          )
      )}
    </div>
  );
}
